(window.webpackJsonp=window.webpackJsonp||[]).push([[0],{146:function(t,n,e){e(147),e(412),t.exports=e(408)},369:function(t,n,e){var o={"./01-title.md":370,"./02-precourse-knockout/01-title.md":371,"./02-precourse-knockout/02-lesson-overview.md":372,"./02-precourse-knockout/03-lesson-goals.md":373,"./02-precourse-knockout/04-simple-view-model.md":374,"./02-precourse-knockout/05-bindings.md":375,"./02-precourse-knockout/06-subscriptions.md":376,"./02-precourse-knockout/07-subscriptions-cont.md":377,"./02-precourse-knockout/08-subscriptions-markup.md":378,"./02-precourse-knockout/09-control-logic.md":379,"./02-precourse-knockout/10-control-logic-cont.md":380,"./02-precourse-knockout/11-components.md":381,"./02-precourse-knockout/12-component-declaration.md":382,"./02-precourse-knockout/13-multiple-components.md":383,"./02-precourse-knockout/14-reusing-components.md":384,"./03-module1/01-title.md":385,"./03-module1/02-overview/01-app-overview.md":386,"./03-module1/02-overview/02-contributing.md":387,"./03-module1/02-overview/03-major-concepts.md":388,"./03-module1/02-overview/04-extending-arches.md":389,"./03-module1/03-lesson-goals.md":390,"./03-module1/04-arches-design-goals.md":391,"./03-module1/05-core-technologies.md":392,"./03-module1/06-managing-dependencies.md":393,"./03-module1/07-contributing-to-arches.md":394,"./03-module1/08-graphs.md":395,"./03-module1/09-datatypes.md":396,"./03-module1/10-ui-representation.md":397,"./03-module1/11-functions.md":398,"./03-module1/12-code-organization.md":399,"./03-module1/13-packages.md":400,"./09-project-package/01-module9_draft.md":401,"./09-project-package/09-project-package/01-lesson-goals.md":402,"./09-project-package/09-project-package/02-projects-overview.md":403,"./09-project-package/09-project-package/03-projects-directory-structure.md":404,"./09-project-package/09-project-package/04-packages-overview.md":405,"./09-project-package/09-project-package/05-packages-directory-structure.md":406,"./09-project-package/09-project-package/06-packages-details.md":407};function i(t){var n=l(t);return e(n)}function l(t){var n=o[t];if(!(n+1)){var e=new Error("Cannot find module '"+t+"'");throw e.code="MODULE_NOT_FOUND",e}return n}i.keys=function(){return Object.keys(o)},i.resolve=l,t.exports=i,i.id=369},370:function(t,n){t.exports='<h1 id="arches-developer-training">Arches Developer Training</h1>\n<h2 id="fall-2018">Fall 2018</h2>\n'},371:function(t,n){t.exports='\x3c!-- sectionTitle: KnockoutJS Intro --\x3e\n\x3c!-- background: jellybean --\x3e\n<h1 id="knockoutjs">KnockoutJS</h1>\n<h2 id="an-introduction">an Introduction</h2>\n'},372:function(t,n){t.exports="<p><strong>Lesson Overview</strong></p>\n<p>In this lesson we will briefly discuss each of the following Knockout concepts with examples and an explanation of how they are used in Arches</p>\n<ul>\n<li>ViewModels</li>\n<li>Data binding</li>\n<li>Computeds/subscriptions</li>\n<li>Control flow</li>\n<li>Scope</li>\n<li>Components</li>\n</ul>\n"},373:function(t,n){t.exports="<p><strong><em>Lesson Goals</em></strong></p>\n<p>To have a basic understanding of KnockoutJS and how the framework is applied in Arches</p>\n<p><strong>What is Knockout?</strong></p>\n<ul>\n<li>Relatively lightweight library</li>\n<li>Easy to learn</li>\n<li>Non-prescriptive regarding application architecture</li>\n<li>Simple to extend with custom bindings</li>\n<li>Allows users to work on isolated parts of the UI with  &#39;components&#39;  </li>\n</ul>\n"},374:function(t,n){t.exports='<p><strong>A very simple ViewModel</strong></p>\n<pre><code class="lang-css">.output {\n    background-color: #ddffdd;\n    width: 150px;\n    margin: 25px;\n}\n</code></pre>\n<pre><code class="lang-html">&lt;label&gt;Artist: &lt;input data-bind=&quot;textInput: artist&quot;&gt;&lt;/input&gt;&lt;/label&gt;\n&lt;label&gt;Album: &lt;input data-bind=&quot;textInput: album&quot;&gt;&lt;/input&gt;&lt;/label&gt;\n&lt;div data-bind=&quot;css: style&quot;&gt;\n    &lt;div data-bind=&quot;text: artist&quot;&gt;&lt;/div&gt;\n    &lt;div data-bind=&quot;text: album&quot;&gt;&lt;/div&gt;\n&lt;/div&gt;\n</code></pre>\n<pre><code class="lang-javascript">function ViewModel() {\n    this.artist = ko.observable();\n    this.album = ko.observable();\n    this.style = &#39;output&#39;\n};\n\nko.applyBindings(new ViewModel());\n</code></pre>\n<p><a href="demos/knockout/demo1.html">demo</a></p>\n'},375:function(t,n){t.exports="<p><strong>Bindings</strong></p>\n<ul>\n<li>text</li>\n<li>inputText</li>\n<li>visible</li>\n<li>css</li>\n<li>style</li>\n<li>attr</li>\n<li>click</li>\n<li>event</li>\n<li>custom binding handlers</li>\n</ul>\n"},376:function(t,n){t.exports="<p><strong>Subscriptions/Computeds</strong></p>\n<ul>\n<li>Subscription - calls a handler when a single observable changes</li>\n<li>Computeds - a function that returns a value if an observable within it changes</li>\n</ul>\n"},377:function(t,n){t.exports='<p><strong><em>Subscriptions/Computeds: ViewModel:</em></strong></p>\n<pre><code class="lang-javascript">this.artist = ko.observable(&quot;&quot;);\nthis.album = ko.observable(&quot;&quot;);\nthis.recentchange = ko.observable();\nthis.albums = ko.observableArray([]);\n\nthis.addAlbum = function(){\n    this.albums.push({artist: this.artist(), album: this.album()});\n};\n\nthis.albums.subscribe(function(albums){\n    var currentItem = _.last(albums)\n    self.recentchange(&quot;You added &quot; + currentItem.artist + &quot;, &quot; + currentItem.album);\n})\n\nthis.summary = ko.computed(function(){\n    var res = &quot;&lt;ul&gt;&quot;\n    _.map(self.albums(), function(album){\n        res += &quot;&lt;li&gt;Artist: &quot; + album.artist + &quot;,   Album: &quot; + album.album + &quot;&lt;/li&gt;&quot;});\n    res += &quot;&lt;/ul&gt;&quot;\n    return res\n});\n</code></pre>\n'},378:function(t,n){t.exports='<p><strong><em>Subscriptions/Computeds: HTML</em></strong></p>\n<pre><code class="lang-html">&lt;label&gt;Artist:  &lt;input data-bind=&quot;textInput: artist&quot;&gt;&lt;/input&gt;&lt;/label&gt;\n&lt;label&gt;Album:  &lt;input data-bind=&quot;textInput: album&quot;&gt;&lt;/input&gt;&lt;/label&gt;\n&lt;button data-bind=&quot;click: addAlbum&quot;&gt;Add&lt;/button&gt;\n&lt;div data-bind=&quot;html: summary&quot;&gt;&lt;/div&gt;\n&lt;p data-bind=&quot;text: recentchange&quot;&gt;&lt;/p&gt;\n</code></pre>\n<p><a href="demos/knockout/demo2-bindings.html">demo</a></p>\n'},379:function(t,n){t.exports='<p><strong>Control logic</strong></p>\n<p><strong><em> Inline and Virtual </em></strong></p>\n<pre><code class="lang-html">&lt;div data-bind=&quot;if: someBooleanValue&quot;&gt;&lt;/div&gt;\n\n&lt;ul&gt;\n    &lt;li&gt;This item always appears&lt;/li&gt;\n    &lt;!-- ko ifnot: someBooleanValue --&gt;\n        &lt;li&gt;display this line&lt;/li&gt;\n    &lt;!-- /ko --&gt;\n&lt;/ul&gt;\n\n</code></pre>\n'},380:function(t,n){t.exports='<p><strong><em>Control Logic - cont.</em></strong></p>\n<ul>\n<li>foreach binding &amp; scope</li>\n</ul>\n<pre><code class="lang-javascript">var geomViewModel = function() {\n    var self = this;\n    self.coords = [{x:37.5,y:-122.1},{x:37.6}, y:-122.0, ...];\n    self.name = &quot;San Francisco&quot;;\n}\n</code></pre>\n<pre><code class="lang-html">&lt;table data-bind=&quot;with: geomViewModel&quot;&gt;\n    &lt;tbody data-bind=&quot;foreach: coords&quot;&gt;\n        &lt;span data-bind=&quot;text: $parent.name&quot;&gt;&lt;/span&gt;\n        &lt;span data-bind=&quot;text: x&quot;&gt; &lt;/span&gt;,\n        &lt;span data-bind=&quot;text: y&quot;&gt; &lt;/span&gt;\n    &lt;tbody&gt;\n&lt;/table&gt;\n</code></pre>\n'},381:function(t,n){t.exports='<p><strong><em>Components</em></strong></p>\n<ul>\n<li>Composed of template and view model</li>\n<li>Reusable within an application</li>\n<li>Registering a component:<pre><code class="lang-javascript">ko.components.register(&#39;album-list&#39;, {\n  viewModel: {require: &#39;js/album-list&#39;},\n  template: {require: &#39;text!templates/album-list.html&#39;}\n});\n</code></pre>\n</li>\n</ul>\n'},382:function(t,n){t.exports='<p><strong>Declaring a component</strong></p>\n<pre><code class="lang-html">&lt;div data-bind=&#39;component: {\n    name: &quot;album-list&quot;,\n    params: {albumlist: albums}\n}&#39;&gt;&lt;/div&gt;\n</code></pre>\n<p><a href="demos/knockout/demo3-components-intro.html">demo</a></p>\n'},383:function(t,n){t.exports='<p><strong>Using multiple components</strong></p>\n<p>Different components can be used to represent the same data differently:</p>\n<pre><code class="lang-html">&lt;div data-bind=&#39;component: {\n    name: &quot;album-list-simple&quot;,\n    params: {title: &quot;Component 1&quot;, albumlist: albums}\n}&#39;&gt;&lt;/div&gt;\n\n&lt;div data-bind=&#39;component: {\n    name: &quot;album-list&quot;,\n    params: {title: &quot;Component 2&quot;, albumlist: albums}\n}&#39;&gt;&lt;/div&gt;\n</code></pre>\n<p><a href="demos/Knockout/demo4-components.html">demo</a></p>\n'},384:function(t,n){t.exports='<p><strong><em>Reusing Components</em></strong></p>\n<p>Components can be reused within an application with different configurations:</p>\n<pre><code class="lang-html">&lt;div data-bind=&#39;component: {\n    name: &quot;album-list&quot;,\n    params: {title: &quot;Component&quot;, albumlist: albums}\n}&#39;&gt;&lt;/div&gt;\n\n&lt;div data-bind=&#39;component: {\n    name: &quot;album-list&quot;,\n    params: {title: &quot;Same component&quot;, albumlist: albums, context: &quot;agg&quot;}\n}&#39;&gt;&lt;/div&gt;\n\n&lt;!--ko if: context --&gt;\n    &lt;div style=&quot;padding-top: 10px&quot; data-bind=&quot;text: &#39;Album count: &#39; + albums().length&quot;&gt;&lt;/div&gt;\n&lt;!-- /ko --&gt;\n</code></pre>\n<p><a href="demos/knockout/demo5-components.html">demo</a></p>\n'},385:function(t,n){t.exports='\x3c!-- sectionTitle: The Arches Platform --\x3e\n<h1 id="module-1">Module 1</h1>\n<h2 id="the-arches-platform">The Arches Platform</h2>\n<h2 id="and">and</h2>\n<h2 id="core-technical-concepts">Core Technical Concepts</h2>\n'},386:function(t,n){t.exports="\x3c!-- background: jellybean --\x3e\n<p>Arches Application Overview</p>\n<ul>\n<li>Design goals</li>\n<li>Core technologies and system architecture</li>\n</ul>\n"},387:function(t,n){t.exports="<p>Contributing to Arches</p>\n<ul>\n<li>Submitting tickets/zenhub</li>\n<li>Writing documentation</li>\n<li>Code conventions and submitting pull requests</li>\n<li>Developer Code of Conduct</li>\n<li>Where to get more help</li>\n</ul>\n"},388:function(t,n){t.exports="<p>Major Arches Concepts</p>\n<ul>\n<li>Graphs, datatypes, cards, tiles ...</li>\n</ul>\n"},389:function(t,n){t.exports="<p>Extending Arches for your application</p>\n<ul>\n<li>Building custom components (datatypes, widgets, cards, reports)</li>\n<li>Putting it all together: Package development</li>\n</ul>\n"},390:function(t,n){t.exports="<p><strong><em>Lesson Goals</em></strong></p>\n<ul>\n<li>Understand the basic architecture of Arches</li>\n<li>Be familiar with Arches concepts and nomenclature</li>\n<li>Understand how developers contribute to Arches</li>\n<li>Be aware of the ways in which you can extend Arches</li>\n<li>Understand how Arches applications and packages are related</li>\n<li>Know where to find more help</li>\n</ul>\n"},391:function(t,n){t.exports='<p><strong>Design Goals</strong></p>\n<ul>\n<li>Open Source</li>\n<li>Multi-language</li>\n<li>Standards based<ul>\n<li>CRM - Conceptual Reference Model (<a href="http://www.cidoc-crm.org/">http://www.cidoc-crm.org/</a>)</li>\n</ul>\n</li>\n<li>Graph Data Structure<ul>\n<li>Supports concept management</li>\n<li>Allows for a dynamic logical data model (graph) with a static physical model (db schema)</li>\n<li>PostgreSQL(relational + JSON) ideal for its spatial capabilities</li>\n</ul>\n</li>\n<li>Interoperable: Data could be used in other systems</li>\n</ul>\n<p>These qualities make Arches highly adaptable to different use cases and geographic contexts</p>\n'},392:function(t,n){t.exports="<p><strong>Core Technologies and System Architecture</strong></p>\n<ul>\n<li>Django: server-side web framework</li>\n<li>PostgreSQL/PostGIS: Data store of record (as opposed to the Elasticsearch index)</li>\n<li>Elasticsearch (requires Java): Indexes business data to support search</li>\n<li>TileStache: Caches vector and raster tiles</li>\n<li>Knockout.js: UI framework</li>\n</ul>\n"},393:function(t,n){t.exports="<p><strong>Managing dependencies</strong></p>\n<ul>\n<li>Node/Yarn</li>\n<li>Require.js</li>\n</ul>\n"},394:function(t,n){t.exports='<p><strong>Contributing to Arches</strong></p>\n<ul>\n<li><p>Communicating about development issues:</p>\n<ul>\n<li>Ask questions on the forum: <a href="https://groups.google.com/forum/#!forum/archesproject">https://groups.google.com/forum/#!forum/archesproject</a></li>\n<li>Write a ticket on GitHub: <a href="https://github.com/archesproject/arches">https://github.com/archesproject/arches</a></li>\n</ul>\n</li>\n<li><p>Coding Conventions:</p>\n<ul>\n<li>PEP 8</li>\n<li>ESlint: &#39;recommended&#39;</li>\n</ul>\n</li>\n<li><p>Writing documentation:</p>\n<ul>\n<li>Documentation is in a dedicated repo</li>\n<li>Written in restructured text</li>\n<li>Converted to HTML using Sphinx</li>\n</ul>\n</li>\n<li><p>Submitting pull requests:</p>\n</li>\n<li><p>Developer Code of Conduct</p>\n</li>\n</ul>\n'},395:function(t,n){t.exports="<p><strong>Graphs</strong></p>\n<ul>\n<li>Resource Models<ul>\n<li>The blueprint of a resource instance</li>\n<li>Conceptually similar to a class in an object-oriented programming language</li>\n<li>Composed of a root node and one or more branches</li>\n</ul>\n</li>\n<li>Branches<ul>\n<li>Building blocks of a resource model</li>\n<li>Generally composed of nodes of a particular theme</li>\n<li>Nodes on a branch that share the same parent comprise a Nodegroup</li>\n</ul>\n</li>\n<li>Nodes<ul>\n<li>The smallest unit of a resource model</li>\n<li>Semantic or data collecting</li>\n</ul>\n</li>\n<li>Edges<ul>\n<li>Relationships between nodes.</li>\n<li>In some cases has a relationship with its parent defined</li>\n</ul>\n</li>\n</ul>\n"},396:function(t,n){t.exports="<p><strong>Datatypes</strong></p>\n<p>Defines how data is managed for a node</p>\n<ul>\n<li>String</li>\n<li>Number</li>\n<li>Boolean</li>\n<li>Date</li>\n<li>EDTF</li>\n<li>Concept</li>\n<li>Domain</li>\n<li>GeoJson</li>\n</ul>\n<p>Example operations:</p>\n<pre><code>- Validation\n- Transforming data when indexed in Elasticsearch\n- Transforming data on import and export\n- Defines search filters for its type\n</code></pre>"},397:function(t,n){t.exports='<p><strong>UI Representation</strong></p>\n<ul>\n<li>Cards - UI representation of a <strong>nodegroups</strong></li>\n<li>Widgets - UI representation of a <strong>node</strong> based on datatype</li>\n<li>A datatype can be represented by different widgets</li>\n</ul>\n<table>\n<thead>\n<tr>\n<th style="text-align:center">datatype</th>\n<th style="text-align:center">widgets</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td style="text-align:center">boolean</td>\n<td style="text-align:center">radio, switch, select</td>\n</tr>\n<tr>\n<td style="text-align:center">string</td>\n<td style="text-align:center">input, rich text editor</td>\n</tr>\n<tr>\n<td style="text-align:center">domain</td>\n<td style="text-align:center">radio, select</td>\n</tr>\n<tr>\n<td style="text-align:center">concept</td>\n<td style="text-align:center">radio, select</td>\n</tr>\n</tbody>\n</table>\n'},398:function(t,n){t.exports="<p><strong>Functions</strong></p>\n<p>Custom data processing operations triggered when Arches retrieves, saves, or deletes data belonging to a specified nodegroup.</p>\n<p>Conceptually similar to a database trigger.</p>\n<p>Ships with Arches: The display descriptors function</p>\n"},399:function(t,n){t.exports="<p><strong>Code organization</strong></p>\n<p>If you&#39;re comfortable with Django, Arches will look very familiar</p>\n<p>Django template file paths and names generally match their javascript couterparts:</p>\n<pre><code>- arches/app/templates/views/components/widgets/number.htm\n- arches/app/media/js/views/components/widgets/number.js\n</code></pre>"},400:function(t,n){t.exports="<p><strong>Packages</strong></p>\n<p>Organization of files used to implement an Arches application</p>\n<ul>\n<li>Business data</li>\n<li>Resource models and branches</li>\n<li>Custom cards, datatypes, widgets, report templates</li>\n</ul>\n<p>In contrast, a <strong><em>Project</em></strong> is essentially a Django <code>project</code>.</p>\n"},401:function(t,n){t.exports='\x3c!-- sectionTitle: Projects and Packages --\x3e\n<h1 id="module-9">Module 9</h1>\n<h2 id="projects-and-packages">Projects and Packages</h2>\n'},402:function(t,n){t.exports="<p><strong><em>Lesson Goals</em></strong></p>\n<ul>\n<li>To understand the distinction between a project and a package</li>\n<li>To be familiar with the directory structure of a project and a package</li>\n<li>To understand how to create and maintain your own project and/or package</li>\n<li>To understand how Arches applications and packages are related</li>\n<li>To know how to host and contribute to a project or package</li>\n</ul>\n"},403:function(t,n){t.exports='<p><strong>Projects</strong></p>\n<ul>\n<li>Projects facilitate all of the customizations that you will need to make one installation of Arches different from the next</li>\n<li>You can update html to modify web page branding, and add functions, datatypes, and widgets to introduce new functionality</li>\n<li>A project sits outside of your virtual environment, and can thus be transferred to any other system where Arches is installed\n(source: arches documentation, <a href="https://arches.readthedocs.io/en/stable/projects-and-packages/#projects">https://arches.readthedocs.io/en/stable/projects-and-packages/#projects</a>)</li>\n<li>Contains your site specific django settings<ul>\n<li>(show hierarchy of settings files and how the inheritance structure works)</li>\n</ul>\n</li>\n</ul>\n<ul>\n<li>Many project-specific settings are defined in settings.py. You should use settings_local.py to store variables that you may want to keep out of the public eye (db passwords, API keys, etc.).</li>\n<li>The templates directory holds HTML templates that you can modify to customize the branding and general appearance of your project.</li>\n</ul>\n'},404:function(t,n){t.exports="<p><strong>Project Directory Structure</strong></p>\n<pre><code>Example Project\n├── datatypes\n├── functions\n├── logs\n├── media\n│   ├── img\n│   │   └── landing\n│   ├── js\n│   │   ├── reports\n│   │   └── views\n│   │       └── components\n│   └── packages\n├── node_modules\n├── system_settings\n├── templates\n│   └── views\n│       └── components\n│           ├── functions\n│           └── widgets\n├── uploadedfiles\n└── widgets\n</code></pre>"},405:function(t,n){t.exports="<p><strong>Packages</strong></p>\n<ul>\n<li>A package contains all the data you&#39;d like loaded into your Arches implementation<ul>\n<li>business data</li>\n<li>concepts/reference data</li>\n<li>resource models/branches</li>\n<li>datatypes/functions/widgets</li>\n<li>map layers</li>\n</ul>\n</li>\n<li>Each of these components can be loaded separately</li>\n<li>The whole package can be loaded from local file system or directly from github</li>\n<li>Also contains package specific settings (e.g. load order of business data, date format of business data)</li>\n<li>A local package may be updated if you make changes in your deployment of Arches (eg changes to branches and/or resource models)</li>\n</ul>\n"},406:function(t,n){t.exports="<p><strong>Package Directory Structure</strong></p>\n<pre><code>Example Package\n├── business_data\n│   ├── files\n│   └── relations\n├── extensions\n│   ├── datatypes\n│   ├── functions\n│   └── widgets\n├── graphs\n│   ├── branches\n│   └── resource_models\n├── map_layers\n│   ├── mapbox_spec_json\n│   │   ├── basemaps\n│   │   └── overlays\n│   └── tile_server\n│       ├── basemaps\n│       └── overlays\n├── preliminary_sql\n├── reference_data\n│   ├── collections\n│   └── concepts\n├── staging_data\n└── system_settings\n</code></pre>"},407:function(t,n){t.exports="<p><strong>Package Config vs Package Settings</strong></p>\n<p>Package Settings</p>\n<ul>\n<li>The django settings relevant to your project not managed in system settings. For example, you may want to include your time wheel configuration and your analysis SRID settings in this file so that users do not have add these settings manually to their own settings file after loading your package. This file is copied into your project when the package is loaded.</li>\n</ul>\n<p>Package Config</p>\n<ul>\n<li>This file allows you to configure other parts of the data loading process. For example, the order in which the business data files are loaded</li>\n</ul>\n"},409:function(t,n,e){var o=e(410);"string"==typeof o&&(o=[[t.i,o,""]]);var i={hmr:!0,transform:void 0,insertInto:void 0};e(51)(o,i);o.locals&&(t.exports=o.locals)},410:function(t,n,e){}},[[146,5,3]],[4]]);